import React, {useContext} from "react";
import { MyContext } from "../../App";
import "./index.css";

export function Signup() {
    const { isLogged } = useContext(MyContext);
    if(isLogged) {
        alert("You are already logged in");
       window.location.href = "/home";
    }

    return (
        <>
        <main>
            <div class="form-box signup">
            <div class="button-box">
                <h4>Create New Account</h4>
            </div>
            <form id="login" class="input-grp" action="index.html">
                <input type="text" class="input-field" placeholder="Enter username" required />
                <input type="text" class="input-field" placeholder="Enter 5 digit account number" required />
                <input type="text" class="input-field" placeholder="Enter Password" required />
                <input type="text" class="input-field" placeholder="Re-enter Password" required />
                <button type="submit" class="submit-btn">Sign Up</button>
            </form>
            </div>
        </main>
        </>
    );
}
